function PDFifySession(event, type, download,prefix) {
    //Note: Logo numbering is stupid and arbitrary at the moment.  Can't be fucked to fix this.
    IMAGEDICT.logo1=getBase64Image($("#logo1")[0]);
    IMAGEDICT.logo2=getBase64Image($("#logo2")[0]);
    IMAGEDICT.logo3=getBase64Image($("#logo3")[0]);
    IMAGEDICT.logo4=getBase64Image($("#logo4")[0]);
    var doc = new PdfDoc(event);
    for (var i = 0; i < event.allSessions.length; i++) {
        if (event.allSessions[i].type != type) continue;
        try {
            if (event.allSessions[i].nLocs > 4) {
                doc.pageOrientation='landscape';
                doc.background = landscapeBackground;
            }
            sessionPage(doc, event.allSessions[i],genSessionTable(event, event.allSessions[i]));
        } catch (err) {
            alert("Error: " + err.message);
        }
    }
    if (doc.content.length == 0) return;
    // Delete the last page break
    doc.content.splice(doc.content.length-1);
    try {
        if (download) pdfMake.createPdf(doc).download((prefix+"-"+type.name+"-schedule.pdf").replace(/ /g, "-"));
        else pdfMake.createPdf(doc).open();
    } catch (err) {
        alert ("Error printing: " + err.message);
    }
}

function sessionPage(doc, session, data) {
	// headers are automatically repeated if the table spans over multiple pages
	// you can declare how many rows should be treated as headers
    var t = {headerRows: 1,dontBreakRows: true};
    t.widths = new Array(session.nLocs+2);
    var w = 515/(session.nLocs+2);
    for (var i = 0; i < session.nLocs+2; i++) t.widths[i] = (i<2) ? 'auto':'*';
    t.widths[0] = w;
    t.body = [];
    //Header row
    var header = [];
    for (var i = 0; i < data[0].length; i++) header.push({text:data[0][i],alignment:'center'});
    t.body.push(header);

    // All individual rows
	for (var i = 1; i < data.length; i++) {
		var row = [];
        row.push({text:data[i][0],alignment:'center'});
        row.push({text:data[i][1],alignment:'center'});
        if (data[i][2].startsWith("colSpan")) {
            cols = data[i][2].split(' ')[1];
            row.push({colSpan:cols,style:'breakrow',text:""+data[i][2].split(' ')[2]});
            t.body.push(row);
            continue;
        }
        var diff = session.nLocs;
        for (var j = 2; j < data[i].length; j++) {
            if (data[i][j] == "") row.push({}); 
            else row.push({text:data[i][j],style: 'teamEntry'});
        }
        t.body.push(row);
    }
    console.log(t);
    doc.content.push({text: session.name + " Schedule", style:'header2',margin:[0,10]});
    doc.content.push({table: t,layout: 'lightHorizontalLines'});
    if (usesSurrogates && session.fillerPolicy == USE_SURROGATES)
	    doc.content.push({text:"\n* Surrogate team; results not counted",alignment:'center'});

    doc.content.push({text: " ", pageBreak:'after'});
    return doc;
}

function PDFifyAllTeams(event,download,prefix) {
	var doc = new PdfDoc(event);
	doc.pageOrientation='landscape';
    doc.background = landscapeBackground;
    doc.content.push({text: "All Team Schedule", style:'header2',margin:[0,10]});
    var N = 0;
    for (var i = 0; i < event.allSessions.length; i++){
    	if (event.allSessions[i].type != TYPE_BREAK) N++;
    }
    N = (N+1)*2+1;
    if (usesSurrogates) N += 2;
    var t = {headerRows: 2,dontBreakRows: true,keepWithHeaderRows: 1};
    t.widths = new Array(N);
    var w = 600/N;
    for (var i = 0; i < N; i++) {
        t.widths[i] = 'auto';
    }
    t.body = new Array(2);
    t.body[0] = [];
    t.body[0].push({text: "Team",colSpan:2,style:'tablehead'});
    t.body[0].push({});
	for (var i = 0; i < event.allSessions.length; i++) { 
		if (event.allSessions[i].type == TYPE_BREAK) continue;
        var col = (i%2 == 1) ? 'blue' : 'black';
		t.body[0].push({text: event.allSessions[i].name,colSpan:2,style:'tablehead',color:col});
        // t.body[0].push({});
        t.body[0].push({});
    }
    t.body[0].push({text: " "});
    t.body[1] = [];
    t.body[1].push({text: "#",style:'tablehead'});
    t.body[1].push({text: "Name",style:'tablehead'});
	if (usesSurrogates) {
		t.body[0].push({text: "Surrogate",colSpan:2,style:'tablehead',color:col});
        // t.body[0].push({});
        t.body[0].push({});
	}
	for (var i = 0; i < event.allSessions.length; i++) { 
		if (event.allSessions[i].type == TYPE_BREAK) continue;
        var col = (i%2 == 1) ? 'blue' : 'black';
        // t.body[1].push({text: "#",style:'tablehead', color:col});
        t.body[1].push({text: "Time",style:'tablehead', color:col});
        t.body[1].push({text: "Loc",style:'tablehead', color:col});
    }
    t.body[1].push({text: "Min travel time",style:'tablehead'});
	if (usesSurrogates) {
	    // t.body[1].push({text: "#",style:'tablehead'});
	    t.body[1].push({text: "Time",style:'tablehead'});
	    t.body[1].push({text: "Loc",style:'tablehead'});
	}

	for (var i = 0; i < event.teams.length; i++) {
		var row = new Array();
		var team = event.teams[i];
		row.push({text: team.number+"", style:'tablebody'});
		row.push({text: team.name+"", style:'tablebody'});
		for (var j = 0; j < team.schedule.length; j++) {
            var col = (j%2 == 1) ? 'blue' : 'black';
			if (getSession(team.schedule[j].session_uid).type == TYPE_BREAK) continue;
			if (team.schedule[j].teams && (team.schedule[j].teams.length - team.schedule[j].teams.indexOf((team.uid))) <= team.schedule[j].surrogates) continue; // Surrogate
            if (!team.schedule[j].teams) {
                // row.push({text:""});
                row.push({text:""});
                row.push({text:""});
            } else {
               	// row.push({text: team.schedule[j].num+"", style:'tablebody', color:col});
               	row.push({text: minsToDT(team.schedule[j].time,"\n")+"", style:'tablebody', color:col});
               	row.push({text: getSession(team.schedule[j].session_uid).locations[team.schedule[j].teams.indexOf(team.uid)+team.schedule[j].loc]+"", style:'tablebody', color:col});
            }
		}
		row.push({text: minTravelTime(team)+"", style:'tablebody', color:col});
		for (var j = 0; j < team.schedule.length; j++) {
            var col = (j%2 == 1) ? 'blue' : 'black';
            if (!team.schedule[j].teams) continue;
			if ((team.schedule[j].teams.length - team.schedule[j].teams.indexOf((team.uid))) > team.schedule[j].surrogates) continue; // Not a surrogate
           	// row.push({text: team.schedule[j].num+"", style:'tablebody', color:col});
           	row.push({text: minsToDT(team.schedule[j].time,"\n")+"", style:'tablebody', color:col});
           	row.push({text: getSession(team.schedule[j].session_uid).locations[team.schedule[j].teams.indexOf(team.uid)+team.schedule[j].loc]+"", style:'tablebody', color:col});
		}
		if (usesSurrogates && !team.isSurrogate) {
			// row.push({});
			row.push({});
			row.push({});
		}
		t.body.push(row);
	}
	doc.content.push({table: t, layout: 'lightHorizontalLines'});
    console.log(doc);
    if (download) pdfMake.createPdf(doc).download((prefix+"-individual-schedule.pdf").replace(/ /g, '-'));
    else pdfMake.createPdf(doc).open();    
}

function PDFifyIndivTeams(event, download,prefix) {
    var doc = new PdfDoc(event);
    for (var i = 0; i < event.teams.length; i++) {
        teamPage(doc, event, event.teams[i]);
    }
    // Delete the last page break
    doc.content.splice(doc.content.length-1);
    if (download) pdfMake.createPdf(doc).download((prefix+"-team-schedule.pdf").replace(/ /g, '-'));
    else pdfMake.createPdf(doc).open();    
}

function teamPage(doc, event, team) {
	var schedule = [];
    for (var i = 0; i < team.schedule.length; i++)
        if (team.schedule[i].teams) schedule.push(team.schedule[i]);
	schedule.sort(function(a,b) {
		return a.time - b.time;
	});

    doc.content.push({text: team.number + ": " + team.name, style:'header2',margin:[0,10]});
    var t = {headerRows:1,dontBreakRows:true};
    t.widths = new Array(3);
    var w = 515/(3);
    for (var i = 0; i < 3; i++) {
        t.widths[i] = (i<-1) ? 'auto':'*';
    }
    t.body = [];
    t.body[0] = [];
    t.body[0][0] = {text: "Time (#)"};
    t.body[0][1] = {text:"Event"};
    t.body[0][2] = {text:"Location"};
    for (var i = 0; i < schedule.length; i++) {
        // If it's a break that applies to specific sessions, don't put it in.
        if (getSession(schedule[i].session_uid).type == TYPE_BREAK && getSession(schedule[i].session_uid).appliesTo.length > 0) continue;
    	var row = [];
    	var spot = schedule[i].teams.indexOf(team.uid);
    	var num =" ("+schedule[i].num+")";
		if ((schedule[i].teams.length - schedule[i].teams.indexOf((team.uid))) <= schedule[i].surrogates) num = " ("+schedule[i].num+", surrogate)";
		if (getSession(schedule[i].session_uid).type == TYPE_BREAK) num ="";

		var loc = getSession(schedule[i].session_uid).locations[spot+schedule[i].loc];
        if (getSession(schedule[i].session_uid).type == TYPE_BREAK) loc = getSession(schedule[i].session_uid).locations[0];
		if (!loc) loc = "";
    	row.push({text: minsToDT(schedule[i].time)+num});
    	row.push({text: getSession(schedule[i].session_uid).name});
    	row.push({text: ""+loc});
    	t.body.push(row);
    }
    doc.content.push({table: t, layout: 'lightHorizontalLines'});
    doc.content.push({text: " ", pageBreak:'after'});
}

