// ==================== UTILITIES ==================== //

function getBase64Image(img) {
	if (img.src.substring(0,4) == "data") return img.src;
    if (img.src.endsWith("flllogo.jpg")) return IMAGEDICT.logo1;
    if (img.src.endsWith("gamelogo.jpg")) return IMAGEDICT.logo2;
    if (img.src.endsWith("mqlogo.png")) return IMAGEDICT.logo3;
    if (img.src.endsWith("firstlogo.png")) return IMAGEDICT.logo4;
    // Create an empty canvas element
    var canvas = document.createElement("canvas");
    canvas.width = img.naturalWidth;
    canvas.height = img.naturalHeight;

    // Copy the image contents to the canvas
    var ctx = canvas.getContext("2d");
    ctx.drawImage(img, 0, 0);

    // Get the data-URL formatted image
    // Firefox supports PNG and JPEG. You could check img.src to
    // guess the original format, but be aware the using "image/jpg"
    // will re-encode the image.
    if (img.src.search(new RegExp('.png','i')) != -1) {
	var dataURL = canvas.toDataURL("image/png");
    } else if (img.src.search(new RegExp('.jpe?g','i')) != -1) {
	var dataURL = canvas.toDataURL("image/jpeg");
    }

    return dataURL;
}

